```solidity
pragma solidity ^0.4.24;

contract contractName {
    address public owner;
    mapping (address => uint256) public invalidOrder;
    mapping (address => mapping (address => uint256)) public balanceOf;
    mapping (address => bool) public admins;
    mapping (address => uint256) public lastActiveTransaction;
    address public feeAccount;
    uint256 public inactivityReleasePeriod;

    function setOwner(address newOwner) public {
        require(msg.sender == owner);
        owner = newOwner;
    }

    function setAdmin(address admin, bool isAdmin) public {
        require(msg.sender == owner);
        admins[admin] = isAdmin;
    }

    function depositToken(address token, uint256 amount) public {
        require(token.transferFrom(msg.sender, this, amount));
        balanceOf[token][msg.sender] += amount;
        lastActiveTransaction[msg.sender] = block.number;
    }

    function deposit() payable public {
        balanceOf[0][msg.sender] += msg.value;
        lastActiveTransaction[msg.sender] = block.number;
    }

    function invalidateOrdersBefore(address user, uint256 nonce) public {
        require(admins[msg.sender]);
        require(nonce > invalidOrder[user]);
        invalidOrder[user] = nonce;
    }

    function setInactivityReleasePeriod(uint256 expiry) public {
        require(admins[msg.sender]);
        require(expiry < 0xf4240);
        inactivityReleasePeriod = expiry;
    }

    function withdrawToken(address token, uint256 amount) public {
        require(balanceOf[token][msg.sender] >= amount);
        require(block.number > lastActiveTransaction[msg.sender] + inactivityReleasePeriod);
        balanceOf[token][msg.sender] -= amount;
        require(token.transfer(msg.sender, amount));
    }

    // Implement other functions as described in contract logic
}
